// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.7.0 <0.9.0;


contract TPCoin {

    struct TPtoken {
        uint256 id;
        address owner;
        uint256 value;
        uint256 relatedShippingID;
    }



    mapping(address => TPtoken[]) tokensMap;
    // alternative mapping (uint id = > TPCOIN)
    uint256 lastCreatedID;



    function mint(
        address _owner,
        uint256 _value,
        uint256 _relatedShippingID
    ) external payable   {
        TPtoken memory newToken = TPtoken({
            id: lastCreatedID,
            owner: _owner,
            value: _value,
            relatedShippingID: _relatedShippingID
        });
        tokensMap[_owner].push(newToken);
        lastCreatedID = lastCreatedID + 1;
    }

    function userTokens(address owner) external view returns (TPtoken[] memory) {
        return tokensMap[owner];
    }

    function burn(address _owner, uint256 _id) public {
        for (uint256 i = 0; i < (tokensMap[_owner]).length; i++) {
            if (_id == tokensMap[_owner][i].id) {
                tokensMap[_owner][i] = tokensMap[_owner][
                    (tokensMap[_owner]).length - 1
                ];
                tokensMap[_owner].pop();
                break;
            }
        }
    }
}
